var prec uint = 256
var two = bignum.NewFloat(2, prec)

func fBig(x, one *big.Float) (y *big.Float) {
	y = new(big.Float).SetPrec(x.Prec())
	if x.Cmp(y) > 0 {
		y.Sub(y, one)
		y.Quo(y, x)
		y.Quo(y, two)
		return bignum.Exp(y)
	}
	return
}

func gBig(x, one *big.Float) (y *big.Float) {
	y = fBig(x, one)
	d := new(big.Float).Sub(one, x)
	d = fBig(d, one)
	d.Add(d, y)
	y.Quo(y, d)
	return
}

